import React from "react";
import { NavLink } from "react-router-dom";
import s from "./Dialogs.module.css";

const DialogItem = (props) => {
  let path = "/dialogs/" + props.id;

  return <NavLink to={path}>{props.name}</NavLink>;
};

const Dialogs = () => {
  return (
    <div className={s.dialogs}>
      <div className={s.dialogsItems}>
        <DialogItem name="Victor" id="1">
          <div className={s.dialog}>July</div>
          <div className={s.dialog}>Kate</div>
          <div className={s.dialog}>Nasty</div>
          <div className={s.dialog}>Irina</div>
        </DialogItem>
        <div className={s.massages}>
          <div className={s.massage}>Hi!What's up?</div>
          <div className={s.massage}>Great!</div>
          <div className={s.massage}>Yo</div>
        </div>
      </div>
    </div>
  );
};

export default Dialogs;
